import React from "react";

const Header = ({ name }) => (
  <h1>{name}</h1>
)
/*
const Content = ({ parts }) => {
  return (
    <ul >
      {parts.map(part => <li key={part.id} >{part.name} {part.exercises}</li>)}
      <li>total of {parts.reduce((sum, part) => sum+part.exercises, 0)} exercises</li>
    </ul>
  )
}
*/
const Course = ({ course }) => {
  return (
    <ul>
      <Header name={course.map(course=> <li key={course.id}>{course.name} </li>)} />
    </ul>

  )
}
const App = () => {
  const courses = [{
    name: 'Half Stack application development',
    id: 1,
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      },
      {
        name: 'Redux',
        exercises: 11,
        id: 4
      }
    ]
  }, 
  {
    name: 'Node.js',
    id: 2,
    parts: [
      {
        name: 'Routing',
        exercises: 3,
        id: 1
      },
      {
        name: 'Middlewares',
        exercises: 7,
        id: 2
      }
    ]
  }
]

  return <Course courses={courses} />
}

export default App;
